import React from 'react'

const Hero = () => {
  return (
    <div className='bg-yellow-300'>
      <div className='bg-slate-500'>
        <img src='images/Hero.jpg' alt='hero'  className='w'></img>
      </div>
    </div>
  )
}

export default Hero
